import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import Box from "@mui/material/Box";
import TextField from "@mui/material/TextField";
import Button from "@mui/material/Button";
import { ToastContainer } from "react-toastify";
import { handleSuccess, handleError } from "../utils";
import "./Donar.css";

export default function Donor() {
  const navigate = useNavigate();

  const [donorInfo, setDonorInfo] = useState({
    name: "",
    email: "",
    password: "",
    blood_group: "",
    age: "",
    city: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setDonorInfo({ ...donorInfo, [name]: value });
  };

  const handleDonorRegister = async (e) => {
    e.preventDefault();

    const { name, email, password, blood_group, age, city } = donorInfo;

    if (!name || !email || !password || !blood_group || !age || !city) {
      return handleError("Please fill all fields");
    }

    try {
      const uri = "http://localhost:8080/donor-register";
      const response = await fetch(uri, {
        method: "POST",
        headers: {
          "content-type": "application/json",
        },
        body: JSON.stringify(donorInfo),
      });

      const result = await response.json();
      const { success, error, message } = result;

      if (success) {
        handleSuccess("Donor Registered Successfully");
        setTimeout(() => navigate("/login"), 1000);
      } else if (error) {
        const details = error?.details?.[0]?.message;
        handleError(details || "Validation Error");
      } else {
        handleError(message || "Failed!!");
      }
    } catch (err) {
      handleError("Error while registering donor");
    }
  };

  return (
    <div className="container mt-5">
      <div className="row mt-5">
        <div className="col d-flex justify-content-center mt-5 p-3">
          
          <Box
            sx={{
              width: { xs: "100%", sm: 450 },
              display: "flex",
              flexDirection: "column",
              padding: 3,
              boxShadow: "0px 0px 12px rgba(0,0,0,0.2)",
              borderRadius: 2,
              background: "rgba(255,255,255,0.9)",
            }}
          >
            <h3 className="text-center mb-3">Become a Donor</h3>

            <form
              onSubmit={handleDonorRegister}
              style={{
                display: "flex",
                flexDirection: "column",
                gap: "18px",
              }}
            >
              <TextField
                fullWidth
                label="Full Name"
                name="name"
                value={donorInfo.name}
                onChange={handleChange}
              />

              <TextField
                fullWidth
                label="Email"
                name="email"
                value={donorInfo.email}
                onChange={handleChange}
              />

              <TextField
                fullWidth
                label="Password"
                type="password"
                name="password"
                value={donorInfo.password}
                onChange={handleChange}
              />

              <TextField
                fullWidth
                label="Blood Group"
                name="blood_group"
                value={donorInfo.blood_group}
                onChange={handleChange}
              />

              <TextField
                fullWidth
                label="Age"
                name="age"
                type="number"
                value={donorInfo.age}
                onChange={handleChange}
              />

              <TextField
                fullWidth
                label="City"
                name="city"
                value={donorInfo.city}
                onChange={handleChange}
              />

              <Button
                type="submit"
                variant="contained"
                fullWidth
                sx={{
                  mt: 1,
                  backgroundColor: "#cf2b2b",
                  "&:hover": { backgroundColor: "#b12222" },
                }}
              >
                Register as Donor
              </Button>

              <p className="text-center mt-2">
                Already have an account?{" "}
                <Link to="/login" style={{ color: "#cf2b2b", textDecoration: "none" }}>
                  Login
                </Link>
              </p>
            </form>

            <ToastContainer />
          </Box>

        </div>
      </div>
    </div>
  );
}
